import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ReactiveFormsModule } from '@angular/forms';
import { InstagramloginModule } from './instagramlogin/instagramlogin.module';
import { LoginpageComponent } from './instagramlogin/loginpage/loginpage.component';
@NgModule({
  declarations: [
    AppComponent,
    LoginpageComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule,
    InstagramloginModule,

  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
